func TestFlickrQueryNew(t *testing.T) {
	os.RemoveAll("testData")
	os.Mkdir("testData", 0777)
	testGetter := TestGetter{}
	startTime, err := time.Parse(longForm, "Apr 20, 2015 at 7:54pm (MDT)")
	if err != nil {
		fmt.Println("error parsing time: ", err)
	}
	endTime, err := time.Parse(longForm, "Apr 20, 2015 at 8:54pm (MDT)")
	if err != nil {
		fmt.Println("error parsing time: ", err)
	}
	testResults := flickrQueryNew(testGetter, startTime, endTime, 1, "cats")
	if len(testResults) != 800 {
		t.Errorf("FlickrQueryNew results are %v, should be 800", len(testResults))
	}
	os.RemoveAll("testData")
}

