func TestGetFlickrPhoto(t *testing.T) {
	os.RemoveAll("testData")
	os.Mkdir("testData", 0777)
	convertedAvgRGB := map[string]uint32{
		"red":   37003,
		"green": 24243,
		"blue":  18110,
		"alpha": 65535,
	}
	testPhotoResp := PhotoResponse{Id: "1", Owner: "tester", Secret: "test", Server: "testserver", Farm: 1, Title: "testtitle"}
	// "https://farm1.staticflickr.com/testserver/1_test_s.jpg"
	testPhotoList := make([]FlickrPhoto, 0)
	testGetter := TestGetter{}
	getFlickrPhoto(testPhotoResp, &testPhotoList, testGetter)
	if len(testPhotoList) != 1 {
		t.Errorf("GetFlickrPhoto results are %v, should be 1", len(testPhotoList))
	}
	if testPhotoList[0].AvgRGB["red"] != convertedAvgRGB["red"] || testPhotoList[0].AvgRGB["green"] != convertedAvgRGB["green"] || testPhotoList[0].AvgRGB["blue"] != convertedAvgRGB["blue"] || testPhotoList[0].AvgRGB["alpha"] != convertedAvgRGB["alpha"] {
		t.Errorf("red is %v, should be %v", testPhotoList[0].AvgRGB["red"], convertedAvgRGB["red"])
		t.Errorf("green is %v, should be %v", testPhotoList[0].AvgRGB["green"], convertedAvgRGB["green"])
		t.Errorf("blue is %v, should be %v", testPhotoList[0].AvgRGB["blue"], convertedAvgRGB["blue"])
		t.Errorf("alpha is %v, should be %v", testPhotoList[0].AvgRGB["alpha"], convertedAvgRGB["alpha"])
	}
	os.RemoveAll("testData")
}

