func TestQueryFixer(t *testing.T) {
	os.RemoveAll("testData")
	os.Mkdir("testData", 0777)
	// queryFixer(fg FlickrGetter, startDate time.Time, endDate time.Time, resultsNeeded int, query string, called int) (time.Time, string)
	testGetter := TestGetter{}
	startTime, err := time.Parse(longForm, "Apr 20, 2015 at 7:54pm (MDT)")
	if err != nil {
		fmt.Println("error parsing time: ", err)
	}
	endTime, err := time.Parse(longForm, "Apr 20, 2015 at 8:54pm (MDT)")
	if err != nil {
		fmt.Println("error parsing time: ", err)
	}
	incrementStart, err := time.Parse(longForm, "Jul 4, 2011 at 7:54pm (MDT)")
	if err != nil {
		fmt.Println("error parsing time: ", err)
	}
	testTime, testString := queryFixer(testGetter, startTime, endTime, 1000, "cats", 1)
	if testTime != startTime || testString != "2000" {
		t.Errorf("queryFixer start time is %v, should be %v", testTime.String(), startTime.String())
		t.Errorf("queryFixer result count is %v, should be 2000", testString)
	}
	// not valid results but we're testing incrementing the start time
	testTime, testString = queryFixer(testGetter, startTime, endTime, 8000, "cats", 1)
	if testTime != incrementStart || testString != "2000" {
		t.Errorf("queryFixer start time is %v, should be %v", testTime.String(), incrementStart.String())
		t.Errorf("queryFixer result count is %v, should be 2000", testString)
	}
	os.RemoveAll("testData")
}

